package com.hanains.springcontainer;

public class Friend {

	private String name;
	
	public Friend() {
		// TODO Auto-generated constructor stub
	}

	public String getName() {
		return name;
	}
	
	public void setName(String name) {
		this.name = name;
	}
	
	@Override
	public String toString() {
		return "Friend [name=" + name + "]";
	}
	
	
}
